import React from 'react'
import Item from './Item'

const Items = (props) => {
    const onmousedown = (listId) => {
        props.selectItem(listId)
    }

    const { selectedItems } = props
    let items = []

    for(let i = 0; i < 100; i = i+1){
        items.push(<Item  key={i} listId={i} selectedItems={selectedItems} onmousedown={onmousedown} mousePosition={props.mousePosition}/>)
    }
    return (
        <React.Fragment>
            {items}
        </React.Fragment>
    )
}

export default Items
